window.bookSummaryJSON = "<p>When I finally gathered the courage to run from the man who turned my life into a living nightmare, all I wanted was to escape.</p> <p>I never dreamed I would find myself in the arms of not one but two of the hottest men I’ve ever laid eyes on. When I’m their good girl, they spoil me rotten. Even when I’ve been naughty, they make me feel cherished and loved.</p> <p>But my past isn’t so easily left behind. The man I escaped isn’t going to let me go without a fight, and the only thing my new Daddies require to keep me safe is the one thing I can’t give them—my trust.</p>"; 
